can-construct.constructorExtends.description:
Toggles the behavior of a constructor function called
without the <code>new</code> keyword to extend the constructor function or
create a new instance.
<code class="language-js">var animal = Animal();
// vs
var animal = new Animal();
</code>

can-log.warn.description:
Adds a warning message to the console.
<code>var canLog = require(&quot;can-log&quot;);

canLog.warn(&quot;something evil&quot;);
</code>

can-observation.observed.description:
An object representing an observation.
<code class="language-js">{ &quot;obj&quot;: map, &quot;event&quot;: &quot;prop1&quot; }
</code>

can-route-pushstate.description:
Changes <a href="can-route.html" title="Manage browser history and client state by synchronizing the window.location.hash with a map.">can-route</a> to use <a href="https://developer.mozilla.org/en-US/docs/Web/Guide/API/DOM/Manipulating_the_browser_history">pushstate</a>
to change the window's <a href="https://developer.mozilla.org/en-US/docs/Web/API/URLUtils.pathname">pathname</a> instead
of the <a href="https://developer.mozilla.org/en-US/docs/Web/API/URLUtils.hash">hash</a>.
<code class="language-js">var route = require(&quot;can-route-pushstate&quot;);

route(&quot;{page}&quot;, { page: &quot;home&quot; });
route.ready();

route.attr(&quot;page&quot;, &quot;user&quot;);

location.pathname; // -&gt; &quot;/user&quot;
</code>

can-view-nodelist.description:
Adds nesting of text nodes
<code>can.view.nodeLists</code> are used to make sure &quot;directly nested&quot; live-binding
sections update content correctly.
Consider the following template:
<code class="language-html">&lt;div&gt;
{{#if items.length}}
    Items:
        {{#items}}
            &lt;label&gt;&lt;/label&gt;
        {{/items}}
{{/if}}
&lt;/div&gt;
</code>
The <code>{{#if}}</code> and <code>{{#items}}</code> seconds are &quot;directly nested&quot; because
they share the same <code>&lt;div&gt;</code> parent element.
If <code>{{#items}}</code> changes the DOM by adding more <code>&lt;labels&gt;</code>,
<code>{{#if}}</code> needs to know about the <code>&lt;labels&gt;</code> to remove them
if <code>{{#if}}</code> is re-rendered.  <code>{{#if}}</code> would be re-rendered, for example, if
all items were removed.

can-set.compares.description:
An object of property names and <code>prop</code> functions.
<code class="language-js">{
  // return `true` if the values should be considered the same:
  lastName: function(aValue, bValue){
    return (&quot;&quot;+aValue).toLowerCase() === (&quot;&quot;+bValue).toLowerCase();
  }
}
</code>

can-set.props.description:
Contains a collection of prop generating functions.
The following functions create <code>compares</code> objects that can be mixed together to create a set <code>Algebra</code>.
<code class="language-js">var set = require(&quot;can-set&quot;);
var algebra = new set.Algebra(
  {
    // ignore this property in set algebra
    sessionId:  function(){ return true }
  },
  set.props.boolean(&quot;completed&quot;),
  set.props.rangeInclusive(&quot;start&quot;,&quot;end&quot;)
);
</code>

can-util/dom/data/data.description:
Allows associating data as a key/value pair for a particular DOM Node.
<code class="language-js">var domData = require(&quot;can-util/dom/data/data&quot;);
</code>

can-util/dom/events/events.description:
Allows you to listen to a domEvent and special domEvents as well as dispatch domEvents.
<code class="language-js">var domEvents = require(&quot;can-util/dom/events/events&quot;);
</code>

can-util/dom/mutate/mutate.description:
Mutate an element by appending, inserting, and removing DOM nodes. Use this so that on the server &quot;inserted&quot; will be fired.
<code class="language-js">var mutate = require(&quot;can-util/dom/mutate/mutate&quot;);

var el = document.createElement(&quot;div&quot;);

el.addEventListener(&quot;inserted&quot;, function(){
  console.log(&quot;Inserted was fired!&quot;);
});

mutate.appendChild.call(document.body, el);
</code>

can-util/dom/class-name/class-name.description:
Allows querying and manipulation of classes on HTML elements
<code class="language-js">var className = require(&quot;can-util/dom/class-name/class-name&quot;);

var fooDiv = document.createElement(&quot;div&quot;);
className.add(fooDiv, &quot;foo&quot;);
fooDiv.outerHTML; //-&gt; '&lt;div class=&quot;foo&quot;&gt;&lt;/div&gt;'
</code>

can-zone/debug.DebugInfo.description:
An array of objects containing information useful for debugging. Gives you the name of the <strong>task</strong> that failed to complete and a <strong>stack</strong> trace of where the error occured.
Each object has a shape of:
<code class="language-js">{
    &quot;task&quot;: &quot;setTimeout&quot;,
    &quot;stack&quot;: Error ....&quot;
}
</code>

can-zone/timeout.TimeoutError.description:
A special type of Error that also includes the number of milliseconds that were waited before timing out.
The error object is included with the timeout module:
<code class="language-js">var timeout = require(&quot;can-zone/timeout&quot;);

var TimeoutError = timeout.TimeoutError;
// Maybe use this to check `instanceof`.
</code>
